import React, { useState, useEffect } from 'react';
import axios from 'axios';
function Data() {
  const [data, setData] = useState([]);



  useEffect(() => {
    axios.get('http://localhost:5000/api/data')
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);
  

 // console.log(data);
  return (
    
    <div className="App">
      <h1>Data from MongoDB Atlas</h1>
      <ul>
        {data.map((item) => (
           
          <li key={item._id}>
            
            Name: {item.name}
            Email: {item.email}
            
             </li>
         
         
        ))}
      </ul>
    </div>
  );
}

export default Data;
